script: |
  super -f text -I q8233.spq | sort > q8233.out

inputs:
  - name: q8233.spq
    data: |
      SELECT 87 FROM tab2 (FORMAT parquet) AS cor0 WHERE + col1 * - 14 + + col1 + + - 84 * 72 NOT BETWEEN ( col1 * 66 + - 67 ) AND col1 + 90;
  - name: tab2

outputs:
  - name: q8233.out
    data: |
      87
      87
      87
